import React from 'react';
import { Link } from 'react-router-dom';
import Apron from './components/Apron';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';

function handleApron(){
  console.log("Apron clicked");
}


export default function Compone(){
    return(
     <>
      <div className='components'>
         <Link to = "/Apron">
         <button onClick= {handleApron} className = "Apron"><b>Apron</b></button>
         </Link>
         <button className = "Drafter"><b>Drafter</b></button>
         <button className = "Calci"><b>Calci</b></button>
         <button className = "qp"><b>Question Paper</b></button>
         <button className = "Books"><b>Books</b></button>
         <button className = "other"><b>Other</b></button>
      </div>
      {/* <div className = "add-icon">
        <FontAwesomeIcon icon ={faPlus} size='2x'></FontAwesomeIcon>
      </div> */}
      {/* <div className='box'>
        <div className='pic'>photo</div>
        <div className='text'>details</div>
      </div> */}
      
     </>
    )
}
